import "./Testing.css";
import {
  CheckCircle,
  DoNotDisturb
} from "@mui/icons-material";
export default function Testing() {
const initialValues = {
	Application_Title: ''
}
const SoftwareSDK = [
    {
        name: 'UbuntuLinux',
        TestStatus: 1 ,
    },
    {
        name: 'Pony',
        TestStatus: 0,
    },
];
const Softwares = () => {
    const myMap = []
    const tables = SoftwareSDK.map(s => (
                 <li key={s.name}>
                    <h2 className="soft">{s.name}
                        <DoNotDisturb className="StatusIcon">
                        </DoNotDisturb>
                    </h2>
                </li>

            ));

    for(const object in SoftwareSDK) {
        //console.log(SoftwareSDK[object])
        for(const value in SoftwareSDK[object]){
            console.log(SoftwareSDK[object][value])
            if(value === 'name'){
                var SoftwareName = SoftwareSDK[object][value]
            }
            else{
                var Status = SoftwareSDK[object][value]
            }
        }
        if ( Status === 0){
            myMap.push(<li key={SoftwareName}>
                    <h2 className="soft">{SoftwareName}
                        <DoNotDisturb className="StatusIcon">
                        </DoNotDisturb>
                    </h2>
                </li>
                )
        }
        else{
            myMap.push(<li key={SoftwareName}>
                    <h2 className="soft">{SoftwareName}
                        <CheckCircle className="StatusIcon">
                        </CheckCircle>
                    </h2>
                </li>
                )
        }
    }
    return myMap
}
const SoftwareList = () => (
    <ul className="SoftwareListCSS">
        <Softwares/>
    </ul>
);


  return (
    <div className="testing">
       <>
            <h2 className="Application">Project Figure what to put on the bottom of my hayride jug</h2>
			<div className="TestResults">
			    <div className="Software">
                    <h2 className="soft">Software
                    </h2>
                    <SoftwareList/>
                </div>

			</div>
	    </>
	    <div className="Hardware">
        <>
            <div>
                <h2 className="Hardware">Hardware</h2>
            </div>
        </>
        </div>
    </div>
  );
}
